import React, { Component } from 'react';
// import Notification from './Notification'
// import ProjectList from '../../project/ProjectList';
import background from '../../assets/images/lobby.jpg'
import AppBar from '../AppBar'
import BottomBar from '../bottombar/BottomBar'
import Modal from '@material-ui/core/Modal';
import './dashboard.css';
// import CustomListItem from '../ListItem'
import ChatBox from '../chatbox/ChatBox'



const imageStyle = {
  width: 1350, height: 580, position: 'absolute', right: 0, left: 0
}


class Dashboard extends Component {

  constructor(props) {
    super(props)
  
    this.state = {
       open: false
    };
  };
  

  handleSubmit = () => {
    this.props.history.push('/storelist');
  }

  handleOpen = () => {
    this.setState({open: true})
  }

  handleClose = () => {
    this.setState({open: false})
  }


  render() {
    return (
      <div className='custom'>
        <AppBar visitor={10} />
        <img src={background} alt='background' style={imageStyle} />

          <div className='exhibitionbtn' onClick={this.handleSubmit}>

          </div> 
          {/* </div> */}
          
          {/* <div className='row'>
            <div className="col s12 m6">
              <ProjectList />
            </div>
            <div className="col s12 m5 offset-m1">
              <Notification />
            </div>
          </div> */}
          <BottomBar />
          {/* <div className='chat-minimised' onClick={this.handleOpen}>
          jwfhdjsgjdbgjbjdfibwulgribjdgvjsb IAM WH SADCFUABF
        </div> */}
        <Modal
        open={this.state.open}
        onClose={this.handleClose}
        // aria-labelledby="simple-modal-title"
        // aria-describedby="simple-modal-description"
      >
        <div className='chat-container'>
        
        <ChatBox />


        </div>
      </Modal>
       </div>

    );
  }
}





export default Dashboard;
